import React, {useState} from 'react';
import {Link} from 'react-router-dom';
import { Button } from './Button';

function Navbar() {
  const [click,setClick] = useState(false)
  const [button,setbutton] = useState(true)

  const showButton = () => {
    if(window.innerWidth <= 960){
      setbutton(false)
    }else {
      setbutton(true)
    }
  }

  window.addEventListener

  
  
  const handleClick =() => setClick(!click)

  const closeMoblieMenu =() => setClick(false)

  return (
    <>
    <nav className='navbar'>
      <div className='navbar-container'>
        <Link to ='/' className='navbar-logo'>
          ALI <i className='fab fa-typo3'/>
        </Link>
        <div className="menu-icon" onClick={handleClick}>
          <i className={click ? 'fas fa-times' : 'fas fa-bars'} />
        </div>
        <ul className={click ? 'nav-menu active' : 'nav-meny'}>
          
          <li className='nav-item'>
            <Link onClick={closeMoblieMenu} className ='nav-links' to={"/"}>Home </Link>
          </li>
          <li className='nav-item'>
            <Link onClick={closeMoblieMenu} className ='nav-links' to={"./Products"}>Products </Link>
          </li>

          <li className='nav-item'>
            <Link onClick={closeMoblieMenu} className ='nav-links' to={"./Services"}>Services </Link>
          </li>

          <li className='nav-item'>
            <Link onClick={closeMoblieMenu} className ='nav-links-Mobile' to={"./Sign-up "}>Sign Up </Link>
          </li>

        </ul>
        {button && <Button buttonStyle={'btn-outline'} >SIGN UP</Button>}
      </div>
    </nav>
    </>
  )
}

export default Navbar
